--
-- Table structure for table `user_info`
--

DROP TABLE IF EXISTS `user_info`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `user_info` (
  `Id` int(11) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `Name` varchar(20) NOT NULL COMMENT '名称',
  `LoginUserName` varchar(20) NOT NULL COMMENT '登陆用户名',
  `Password` varchar(20) NOT NULL COMMENT '登陆密码',
  `Authority` varchar(20) DEFAULT NULL,
  `AreaId` int(11) DEFAULT NULL COMMENT '所属区域Id AreaId指向本表的另一个Id，比如：浙江总代的所属区域是东部大区，杭州店仓的所属区域是浙江总代，其它的所属区域为空',
  `OrderAmount` int(11) NOT NULL DEFAULT '0' COMMENT '订货金额 由后台程序把customerid_orders表里的订货金额合计，赋值给此字段',
  `OrderStyleNumber` int(11) NOT NULL DEFAULT '0' COMMENT '所订货品的款数 也即customerid_orders里的记录行数',
  `OrderProductNumber` int(11) NOT NULL DEFAULT '0' COMMENT '所订货品的件数 也customerid_orders表里ProductNumber字段值的总和',
  `SizeLevel` varchar(100) DEFAULT NULL COMMENT '店仓的店面面积级别 取之有：80平米以下，80-150平米，150-300平米，300-500平米，500+平米',
  `OrderGuideId` varchar(10) DEFAULT NULL COMMENT '订货预算Id',
  `CollectionSet` varchar(500) DEFAULT NULL,
  `SameAs` varchar(45) DEFAULT NULL,
  `SerialOrderBudget` varchar(200) DEFAULT NULL,
  `TypeOrderBudget` varchar(200) DEFAULT NULL COMMENT '品类的订货预算 买家可修改，取值有："办公：10%，家具：80%，装饰：5%，收藏：5%"',
  `BudgetAmount` int(11) DEFAULT NULL COMMENT '预算总金额',
  `ClassOrderBudget` varchar(200) DEFAULT NULL,
  `MinOrderAmount` int(11) DEFAULT NULL,
  `MucaiOrderBudget` varchar(200) DEFAULT NULL,
  `PricezoneOrderBudget` varchar(200) DEFAULT NULL,
  `GuideAmount` int(11) DEFAULT NULL,
  `logined` bit(1) NOT NULL DEFAULT b'0',
  `FirstArea` varchar(20) DEFAULT NULL,
  `SecondArea` varchar(20) DEFAULT NULL,
  `SuperAreaId` int(11) DEFAULT NULL,
  `AreaName` varchar(45) DEFAULT NULL,
  `Brands` varchar(20) DEFAULT NULL,
  `DiscountId` varchar(50) DEFAULT NULL,
  `Discount` varchar(500) DEFAULT NULL,
  `DiscountVisible` bit(1) NOT NULL DEFAULT b'0',
  PRIMARY KEY (`Id`),
  UNIQUE KEY `LoginUserName_UNIQUE` (`LoginUserName`),
  KEY `IDX_user_info_BudgetId` (`OrderGuideId`)
) ENGINE=InnoDB AUTO_INCREMENT=788 DEFAULT CHARSET=utf8 COMMENT='用户信息表 系统所有用户信息表，admin，厂长，大区经理，总代，店仓';
